// import logo from './logo.svg';
import './App.css';
import Navbar from './js/Navbar';
import Home from './js/Home';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';




function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<div>Home Page</div>} />
      </Routes>
    </Router>
  );
}

export default App;
